  # Step 1: Identify the governor of the commander in Central African Republic Civil War
  ?governor a dbo:Politician ;
             dbo:party ?governorParty .

  # Step 2: Find the sports manager associated with Kedah FA and the party of that governor
  ?sportsManager a dbo:SoccerPlayer ;
                  dbo:manager ?kedahFA ;
                  dbo:politicalParty ?governorParty .

