SELECT ?spouse
WHERE {
  # Step 1: Identify Count Ingolf of Rosenborg and his parent (who is a royalty)
  ?ingolf rdf:type dbo:Person ;
             dbo:name "Count Ingolf of Rosenborg" ;
             dbo:parent ?parent .
  FILTER(?parent rdf:type dbo:Royalty) .

  # Step 2: Find the child of that parent
  ?childOfParent rdf:type dbo:Person ;
                 dbo:parent ?parent .

  # Step 3: Identify Frederick Francis III, Grand Duke of Mecklenburg-Schwerin and his child (who is a royalty)
  ?frederick rdf:type dbo:Person ;
             dbo:name "Frederick Francis III, Grand Duke of Mecklenburg-Schwerin" ;
             dbo:child ?royalChild .
  FILTER(?royalChild rdf:type dbo:Royalty) .

  # Step 4: Find the spouse of the parent identified in step 1
  ?spouse rdf:type dbo:Person ;
           dbo:spouse ?parent .
}
